import React, { Component } from "react"

class Listmembre extends Component{
    render(){
        const datas = this.props.datas
        //console.log(datas)
        return(
            <ul className="list-group">{datas.map(arg => <li className="list-group-item">{arg.nom}</li>)}</ul> 
        )
    }
}
export default Listmembre
